import React from 'react';


const Login = () => {

    const login = () => {
        console.log("login");
    }

    return (
        <div className="loginContainer">
            <h1>Login</h1>
            <label>Username</label>
            <input type="text" />

            <label>Password</label>
            <input type="password" />

            <button onClick={login}>Login</button>
        </div>
    )
}

export default Login
